    false,nt"url": null,nt"notes": "NCEI Accession 0130588 contains oceanographic
    and surface meteorological data in netCDF formatted files, which follow the Climate
    and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
    (ACDD). Northern Michigan University collected the data from 45171, Granite Island
    Buoy, an in-situ moored station, in the Great Lakes. GLOS, which assembles data
    from Northern Michigan University and other sub-regional coastal and ocean observing
    systems of the Great Lakes region of the United States, submitted the data to NCEI
    as part of the Integrated Ocean Observing System Data Assembly Centers (IOOS DACs)
    Data Stewardship Program. Each month, NCEI adds to the Accession the data collected
